import Potato from "./Potato";

const foodLike = [
  {
    id: 1,
    name: "chikien",
    image: "data:image/jpeg;base64,"
  },
  {
    id: 2,
    name: "ham",
    image: "data:image/jpeg;base64,"
  }
]


function App() {
  return (
    <div>
      {
        foodLike.map(dish => (<Food key={dish.id} name={dish.name} picture={dish.image} />))
      }
    </div>
  );
}

function Food({name, picture}) {
  return (
    <div>
      <h1>I like {name} </h1>
      <img src={picture} alt={name} />
    </div>
  )
}
export default App